import { db } from "../database";

export const updatePlayerRoute = {
    method: 'POST',
    path: '/api/listings/{id}',
    handler: async (req, h) => {
        const { id } = req.params;
        const { firstName, lastName, gamertag, platform, age, regionID } = req.payload;
        await db.query(`
            UPDATE players
                SET firstName=?, lastName=?, gamertag=?, platform=?, age=?, regionID=?
                WHERE playerID=?
        `, [firstName, lastName, gamertag, platform, age, regionID, id]);
        const { results } = await db.query(
            'SELECT * FROM players WHERE playerID=?', [id],
        );
        return results[0];
    }
}

